import React from "react";
import "./App.css";
import { Switch, Route } from "react";
import CustomerList from "./containers/CustomerList";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/">
            <CustomerList />
          </Route>
          <Route path="/user"></Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
